import { Carousel } from 'antd';
import "../assets/styles.less";
const Index = () => {
  return(
      <Carousel autoplay>
          <h3>
            <img src="/static/images/big-images.jpg" />
          </h3>


          <h3>
            <img src="/static/images/big-images-2.jpg" />
          </h3>

          <h3>
            <img src="/static/images/big-images-3.jpg" />
          </h3>

      </Carousel>

  )
}

export default Index
